  const [checkedCount, setCheckedCount] = useState(0);
  return (
    <div className="App">
      <Task checkedCount={checkedCount} setCheckedCount={setCheckedCount} />
      <DcProgress checkedCount={checkedCount} />
    </div>
  );
}

export default App;
